import { Modal, Button } from "antd";
import React from "react";
import CreateNoteForm from "../Form/CreateNoteForm";

const ModalAdd = ({ visible, loading, closeModal, handleSubmitCreate }) => {
  return (
    <>
      <Modal
        visible={visible}
        title="Create"
        // onOk={handleOk}
        onCancel={closeModal}
        footer={[
          <Button key="back" onClick={closeModal}>
            Return
          </Button>,
          <Button
            key="submit"
            type="primary"
            htmlType="submit"
            form="form"
            loading={loading}
            // onClick={handleOk}
          >
            Submit
          </Button>,
        ]}
      >
        <CreateNoteForm handleSubmitCreate={handleSubmitCreate}/>
      </Modal>
    </>
  );
};

export default ModalAdd;
